import React from 'react';

const ListingList = ({ listings, onUpdate, onDelete }) => {
    const [isEditing, setIsEditing] = useState(null);
    const [editedListing, setEditedListing] = useState({ title: '', description: '', rent: '', address: '', })
    return (
        <div className="container">
            <h2>All Listings</h2>
            <ul>
                {listings.map((listing) => (
                    <li key={listing._id}>
                        <strong>Title: {listing.title}</strong>
                        <p>Description: {listing.description}</p>
                        <p>Rent: {listing.rent}</p>
                        <p>Address: {listing.address}</p>
                        <p>Number of Rooms: {listing.rooms}</p>
                        <p>Email: {listing.email}</p>
                        <button onClick={() => 
                            onDelete(listing._id)}>Delete</button>
                    </li>
                ))}
            </ul>
        </div>
    )
};

export default ListingList;
